import React from 'react';
import "./Notifications.css"

const closePng = require('./close-icon.png');

const Notifications = () => {

    const closeClick = () => {
        console.log("Close button has been clicked");
    };

    return(
        <div className='Notifications'>
            <button
            onClick={closeClick}
            aria-label="Dismiss"
            style={{ 
                color: 'black', 
                cursor: 'pointer',
                backgroundColor: 'transparent', 
                border: 'none',
                float: 'right',
                width: '2px'
            }}
            >
                <img src={closePng} alt="close"></img>
            </button>
            <p>Here is the list of notifications</p>
        </div>
    )
}

export default Notifications
